<p>We firstly create a generator to generate stream data points that will belong to one of three clusters <code>(k=3)</code>. Each data point will have 2 dimensions <code>(d=2)</code>. The data points will follow Gaussian distribution with 5% noise. When a new data point is requested from this data generator, a cluster will be chosen randomly using the probability weights in <code>p</code>.</p>
